import React from 'react';
import './App.css';
import Categoria from './categoria.js';

function App() {
  return (
    <div className="App">
      <ul>
        <Categoria name = 'Home'></Categoria>
        <Categoria name = 'Cliente' items = {['Agregar Cliente','Modificar Cliente','Eliminar Cliente','Listar Cliente']}></Categoria>
        <Categoria name = 'Vendedor' items = {['Agregar Vendedor','Modificar Vendedor','Eliminar Vendedor','Listar Vendedor']}></Categoria>
        <Categoria name = 'Factura' items = {['Agregar Factura','Modificar Factura','Eliminar Factura','Listar Factura']}></Categoria>
        <Categoria name = 'Comision'></Categoria>
      </ul>
    </div>
  );
}

export default App;
